import React from "react";

export const Header = () => {
  return (
    <div className="py-5 px-10">
      <div>
        <input
          type="text"
          placeholder="Add new item..."
          className="py-3 px-3 rounded-xl bg-gray-100"
        />
      </div>
      <div></div>
    </div>
  );
};
